int main(void)
{
    ledInit();
    usartInit();
    zbarInit();
    ili9341_Init();
    while(!OV7725_Init()) continue;
    
    ili9341_SetRange(0, OV7725_IMAGE_SIZE, LCD_X_LENGTH, LCD_Y_LENGTH - OV7725_IMAGE_SIZE);
    ili9341_PrintImage(LCD_X_LENGTH, LCD_Y_LENGTH - OV7725_IMAGE_SIZE, showLogo);
    
    const uint8_t freq = 10;
    uint8_t cnt = 0;
    while(1)
    {
        if(IMAGE_SAVED_FLAG == 2)
        {
            
            FIFO_Prepare();
            cnt++;
            
            if(cnt < freq)
            {
                ili9341_SetRange(0, 0, OV7725_IMAGE_SIZE, OV7725_IMAGE_SIZE);
                ili9341_PrintImage(OV7725_IMAGE_SIZE, OV7725_IMAGE_SIZE, FIFO_ReadPixl);
            }
            else
            {
                GPIO_ResetBits(LED1_GPIO_PORT, LED1_GPIO_PIN);
                
                saveImage();
                zbarDecode();
                
                GPIO_SetBits(LED1_GPIO_PORT, LED1_GPIO_PIN);
                
                cnt = 0;
            }
            IMAGE_SAVED_FLAG = 0;
            
        }
    }
}

void saveImage(void)
{
    uint8_t *p = data_buf;
    uint16_t pixel;
    for(uint8_t h = 0; h < OV7725_IMAGE_SIZE; h++)
    {
        for(uint8_t w = 0; w < OV7725_IMAGE_SIZE; w++)
        {
            pixel = FIFO_ReadPixl();
            if(
                w >= ((OV7725_IMAGE_SIZE - QR_CODE_SIZE) / 2 )
             && w <  ((OV7725_IMAGE_SIZE - QR_CODE_SIZE) / 2 + QR_CODE_SIZE) 
             && h >= ((OV7725_IMAGE_SIZE - QR_CODE_SIZE) / 2 )
             && h <  ((OV7725_IMAGE_SIZE - QR_CODE_SIZE) / 2 + QR_CODE_SIZE)
            ) *(p++) = toGray(pixel);
        }
    }
}

uint8_t toGray(uint16_t pixel)
{
    /*return
    (
        (
            (
                (
                       (pixel        & 0X1F) 
                    + ((pixel >> 11) & 0X1F)
                    + ((pixel >> 6 ) & 0X1F)
                ) / 3
            ) * 0XFFFF / 0X1F
        ) & 0XFF
    );*/
    return
    (
        (
            (
                 (pixel & 0xF800) >> 8) * 76 
               +((pixel & 0x07E0) >> 3) * 150
               +((pixel & 0x001F) << 3) * 30
        ) >> 8
    );
}


