zbar_image_scanner_t *scanner;
zbar_image_t *image;

void zbarInit(void)
{
    scanner = zbar_image_scanner_create();
    zbar_image_scanner_set_config(scanner, ZBAR_NONE, ZBAR_CFG_ENABLE, 1);
    image = zbar_image_create();
    zbar_image_set_format(image, *(int*)"Y800");
    zbar_image_set_size(image, QR_CODE_SIZE, QR_CODE_SIZE);
    zbar_image_set_data(image, (const void*)data_buf, QR_CODE_SIZE * QR_CODE_SIZE, zbar_image_free_data);
}

void zbarDecode(void)
{
    zbar_scan_image(scanner, image);
    
    const zbar_symbol_t *symbol = zbar_image_first_symbol(image);
    const char* data = zbar_symbol_get_data(symbol);
    if(symbol && data) printf("%s\r\n", zbar_symbol_get_data(symbol));
    while((symbol = zbar_symbol_next(symbol)) != NULL);
}      

void USART1_IRQHandler(void)
{
    USART_ClearFlag(USART1, USART_FLAG_TC);
}

/* Camera EXTI */
void OV7725_IRQHandler(void)
{
	//GPIO_ResetBits(LED1_GPIO_PORT, LED1_GPIO_PIN);

    if(EXTI_GetITStatus(OV7725_EXTI_Line))
    {
        if(!IMAGE_SAVED_FLAG)
        {
            FIFO_PointReset();
            IMAGE_SAVED_FLAG = 1;
//            ledSw(led_green, false);
            FIFO_PointMove();
        }
        else if(IMAGE_SAVED_FLAG == 1) 
        {
            FIFO_Pause();
            IMAGE_SAVED_FLAG = 2;
        }
    }

    EXTI_ClearFlag(OV7725_EXTI_Line);
}
